pub enum StructureError {
    Unsorted(&'static str),
    SizeMismatch(&'static str),
    OutOfRange(&'static str),
}

pub enum LinalgError {
    ShapeMismatch(ShapeMismatchInfo),
    NonSquareMatrix,
    SingularMatrix(SingularMatrixInfo),
    ThirdPartyError(isize, &'static str),
}

pub enum IoError {
    Io(io::Error),
    BadMatrixMarketFile,
    UnsupportedMatrixMarketFormat,
}

pub fn lsolve_csc_dense_rhs<N, I, Iptr, V>(CsMatViewI<, N, I, Iptr>, V)
-> Result<(), LinalgError> where N: Clone + Num + std::ops::SubAssign,
for<'r> &'r N: std::ops::Mul<&'r N, Output = N>,
for<'r> &'r N: std::ops::Div<&'r N, Output = N>, V: DenseVectorMut<Scalar =
N>, I: SpIndex, Iptr: SpIndex

pub fn usolve_csc_dense_rhs<N, I, Iptr, V>(CsMatViewI<, N, I, Iptr>, V)
-> Result<(), LinalgError> where N: Clone + Num + std::ops::SubAssign,
for<'r> &'r N: std::ops::Mul<&'r N, Output = N>,
for<'r> &'r N: std::ops::Div<&'r N, Output = N>, V: DenseVectorMut<Scalar =
N>, I: SpIndex, Iptr: SpIndex

pub enum NnzEither<'a, N1: 'a, N2: 'a> {
    Both((usize, &'a N1, &'a N2)),
    Left((usize, &'a N1)),
    Right((usize, &'a N2)),
}

pub enum FillInReduction {
    NoReduction,
    ReverseCuthillMcKee,
    CAMDSuiteSparse,
}
